Pimpin' Ain't Dead is the fifth album released by rap group, Do or Die. It was released on August 19, 2003 for Rap-A-Lot Records/Virgin Records. The album peaked at #115 on the Billboard 200 and #17 on the Top R&amp;B/Hip-Hop Albums.
